text:
My Bay Area colleague, @RepKevinMullin, came to the House Floor — post-surgery — using a walker to vote NO on the budget with us.

@RepPettersen brought her newborn from Colorado to vote NO.

We’re pulling out all the stops—@HouseDemocrats are not going down without a fight.

Just hours after my colleagues and I demanded @USOPM stop Elon's illegal email rule, they backed down. 

Unelected Elon is flailing and he is failing. 

@HouseDemocrats won't let up.
